import { HashRouter as Router, Route, Switch, Routes } from "react-router-dom";
import './App.css';
import Header from './components/Header';
import Home from './pages/Home';
import AboutUs from './pages/AboutUs';
import Projects from './pages/Packages';
import Portfolio from './pages/Portfolio';
import Footer from './components/Footer';
import DesignDetail from "./pages/DesignDetail";

function App() {
  return (
    <Router>
      <div className="App">
        <Header />
        <Routes>
          <Route
            path='/'
            element={<Home />}
          />
          <Route
            path='/designs'
            element={<Portfolio  />}
          />
          <Route
            path="/about"
            element={<AboutUs/>}
            />
          <Route
            path="/contact"/>
          <Route
            path="/packages"
            element={<Projects/>}
            />
            <Route path="/designs/:designId" component={DesignDetail} />
        </Routes>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
